import React from 'react';
import { connect } from 'react-redux';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Accordion from 'react-bootstrap/Accordion';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';

import classes from './View.module.css';

const workoutview = props => {
    console.log(props.match.params);
    console.log(props.workouts);
    const workout = props.workout
    // const sessions = props.workout && props.workout.sessions.length > 0 ? props.workout.session : [];
    const session = props.workout.sessions.map ( x => {
        console.log(x);
    })  
    return(
        <Container className={classes.View} fluid>
            <Row>
                <div className={classes.Title}>
                    <h3>{props.workout.name}</h3>
                    <span>{props.workout.description}</span>
                    <span>{props.workout.created_at}</span>
                </div>
            </Row>
            <Row>
                <div className={classes.Sessions}>
                    <h5>Sessions</h5>
                    <Col md='3'>
                        <Accordion defaultActiveKey="0">
                            <Card>
                                <Card.Header>
                                <Accordion.Toggle as={Button} variant="link" eventKey="0">
                                    Click me!
                                </Accordion.Toggle>
                                </Card.Header>
                                <Accordion.Collapse eventKey="0">
                                <Card.Body>Hello! I'm the body</Card.Body>
                                </Accordion.Collapse>
                            </Card>
                            <Card>
                                <Card.Header>
                                <Accordion.Toggle as={Button} variant="link" eventKey="1">
                                    Click me!
                                </Accordion.Toggle>
                                </Card.Header>
                                <Accordion.Collapse eventKey="1">
                                <Card.Body>Hello! I'm another body</Card.Body>
                                </Accordion.Collapse>
                            </Card>
                        </Accordion>
                    </Col>
                    <Col md='3'>
                        <Accordion defaultActiveKey="0">
                            <Card>
                                <Card.Header>
                                <Accordion.Toggle as={Button} variant="link" eventKey="0">
                                    Click me!
                                </Accordion.Toggle>
                                </Card.Header>
                                <Accordion.Collapse eventKey="0">
                                <Card.Body>Hello! I'm the body</Card.Body>
                                </Accordion.Collapse>
                            </Card>
                            <Card>
                                <Card.Header>
                                <Accordion.Toggle as={Button} variant="link" eventKey="1">
                                    Click me!
                                </Accordion.Toggle>
                                </Card.Header>
                                <Accordion.Collapse eventKey="1">
                                <Card.Body>Hello! I'm another body</Card.Body>
                                </Accordion.Collapse>
                            </Card>
                        </Accordion>
                    </Col>
                </div>
            </Row>
        </Container>
     );
};

const mapStateToProps = state => {
    console.log(state);
    return {
        workout: state.workouts.view
    }
}

export default connect(mapStateToProps)( workoutview );
